import React from "react";
import "./profile.scss";
import anime from 'animejs/lib/anime.es.js';

class Profile extends React.Component{
    componentDidMount() {
        const ad = document.getElementById('kate');
        ad.style.display = 'block';
        ad.style.bottom = '15px';
        ad.style.visibility = 'visible';
    }

    render() {
        anime({
            targets: '#kate',
            translateX: 750,
            scale: 3,
            duration: 500
        });
        anime({
            targets: '.about',
            translateX: -400,
            delay:300,
            duration: 700
        });
        anime({
            targets: '.button',
            translateX: 700,
            duration: 500
        });
        return (
            <main>
                <img src="./img/IMG_0070.jpg" id="kate"/>
                <button className="about">
                    Hi! I am Kate. I am Software Engineer at Huawei.
                    <div className="button__horizontal" id="button__horizontal_about"></div>
                    <div className="button__vertical" id="button__vertical_about"></div>
                </button>
                {/*<div className="b-popup">*/}
                {/*    <div className="b-popup-content">*/}
                {/*        Hi! I am Kate. I am Software Engineer at Huawei.*/}
                {/*    </div>*/}
                {/*</div>*/}

                <button className="button">
                    Projects
                    <div className="button__horizontal"></div>
                    <div className="button__vertical"></div>
                </button>
            </main>
        );
    }
};

export default Profile;
